import React from 'react';
import { Provider } from 'react-redux';
import { store } from './store';
import Topic from './components/Topic';

// 示例数据
const sampleMindMap = {
  id: '1',
  title: '项目计划',
  isCompleted: false,
  children: [
    {
      id: '2',
      title: '需求分析',
      isCompleted: false,
      children: []
    },
    {
      id: '3',
      title: '设计阶段',
      isCompleted: false,
      children: []
    },
    {
      id: '4',
      title: '开发阶段',
      isCompleted: false,
      children: []
    }
  ]
};

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <h1>思维导图任务跟踪</h1>
        <Topic topic={sampleMindMap} />
      </div>
    </Provider>
  );
}

export default App;
